--
-- Table structure for table `productos`
--

DROP TABLE IF EXISTS `productos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `productos` (
  `id_producto` int(10) NOT NULL AUTO_INCREMENT,
  `codigo_producto` varchar(50) NOT NULL,
  `nombre_producto` varchar(50) NOT NULL,
  `departamento` int(10) NOT NULL,
  `precio_compra` decimal(10,3) DEFAULT 0.000,
  `precio_venta` decimal(10,3) DEFAULT 0.000,
  `precio_oferta` decimal(10,6) DEFAULT NULL,
  `oferta_exclusiva` tinyint(1) NOT NULL DEFAULT 0,
  `oferta_caducidad` datetime DEFAULT NULL,
  `oferta_tipo_cliente_id` int(11) DEFAULT NULL,
  `precio_mayoreo` decimal(10,3) DEFAULT 0.000,
  `url_imagen` varchar(512) NOT NULL DEFAULT '0',
  `stock_minimo` int(50) DEFAULT 0,
  `stock_maximo` int(50) DEFAULT 0,
  `tipo_de_venta` int(10) DEFAULT NULL,
  `estado` int(250) DEFAULT NULL,
  `fecha_creacion` timestamp NOT NULL DEFAULT current_timestamp(),
  `fecha_actualizacion` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `creado_por` int(10) DEFAULT NULL,
  `modificado_por_usuario_id` int(11) DEFAULT NULL,
  `proveedor` int(10) DEFAULT NULL,
  `usa_inventario` tinyint(1) NOT NULL DEFAULT 0 COMMENT 'Controla si se gestiona el inventario (1 = Sí, 0 = No)',
  PRIMARY KEY (`id_producto`),
  KEY `fk-estado` (`estado`) USING BTREE,
  KEY `fk_proveedor` (`proveedor`) USING BTREE,
  KEY `fk_unidad_de_medida` (`tipo_de_venta`) USING BTREE,
  KEY `fk_departamento` (`departamento`) USING BTREE,
  KEY `fk_usuario` (`creado_por`) USING BTREE,
  KEY `codigo_producto` (`codigo_producto`) USING BTREE,
  KEY `fk_producto_usuario_mod` (`modificado_por_usuario_id`),
  KEY `fk_oferta_tipo_cliente` (`oferta_tipo_cliente_id`),
  CONSTRAINT `fk_departamentos` FOREIGN KEY (`departamento`) REFERENCES `departamentos` (`id_departamento`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_oferta_tipo_cliente` FOREIGN KEY (`oferta_tipo_cliente_id`) REFERENCES `tipos_cliente` (`id_tipo`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_producto_usuario_mod` FOREIGN KEY (`modificado_por_usuario_id`) REFERENCES `usuarios` (`id_usuario`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `productos_ibfk_1` FOREIGN KEY (`proveedor`) REFERENCES `proveedor` (`id_proveedor`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `productos_ibfk_2` FOREIGN KEY (`creado_por`) REFERENCES `usuarios` (`id_usuario`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `productos_ibfk_3` FOREIGN KEY (`tipo_de_venta`) REFERENCES `unidad_medida` (`id_unidad_medida`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `productos_ibfk_4` FOREIGN KEY (`estado`) REFERENCES `estados` (`id_estado`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2510 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

